import React from 'react';
import styled from 'styled-components';
import Header from '../../components/Header';
import ProductCard from '../../components/ProductCard';

const Page = styled.div`
  background-color: #eee;
  width: 100vw;
  padding: 0 0 30px;
`;

const lorem =
  'Eu exercitation do est ea consequat mollit duis reprehenderit sit. Pariatur elit veniam sit eiusmod pariatur enim proident. Labore aliqua mollit sunt enim est id irure proident tempor commodo adipisicing amet.';

const products = [
  {
    image: 'pp.jpeg',
    title: 'Whey Protein',
    description: lorem,
    price: 80.0
  },
  {
    image: '../../a3bb662d840efe6219c2ff7d8099da8af3b6c41f.webp',
    title: 'Creatina',
    description: lorem,
    price: 30.5
  },
  {
    image: '../../a3bb662d840efe6219c2ff7d8099da8af3b6c41f.webp',
    title: 'Palatinose',
    description: lorem,
    price: 82.45
  }
];



export default function Results(){
    return(
        <Page>
        <Header />
        {products.map((product) => {
          return (
            <ProductCard
              image={product.image}
              title={product.title}
              description={product.description}
              price={product.price}
            />
          );
        })}
      </Page>
    );

};
